import React from "react";
import { Link } from "react-router-dom";
import { Button } from "../conponents";

function Login(props) {
  const [state, setState] = React.useState({
    formData: {
      email: {
        value: "",
        type: "email",
        lable: "email",
        errorMessage: "enter correct email",
        valide: false,
        touched: false,
        validation: {
          required: true,
          email: true,
        },
      },
      password: {
        value: "",
        type: "text",
        label: "password",
        errorMessage: "enter correct password",
        valide: false,
        touched: false,
        validation: {
          required: true,
          password: 9,
        },
      }
    }
  });

  return (
    <div className="authurization">
      <h1>Log In</h1>
      <div className="form">
        <form></form>
      </div>
      <div className="block-of-buttons">
        <Link to="">
          <Button value="Log In" className="singIn" />
        </Link>
        <Link to="/">
          <Button value="Sing In" className="logIn" />
        </Link>
      </div>
    </div>
  );
}

export default Login;
